def add(self, layer):
    """Adds a layer instance on top of the layer stack.

    # Arguments
        layer: layer instance.

    # Raises
        TypeError: If `layer` is not a layer instance.
        ValueError: In case the `layer` argument does not
            know its input shape.
        ValueError: In case the `layer` argument has
            multiple output tensors, or is already connected
            somewhere else (forbidden in `Sequential` models).
    """
    if not isinstance(layer, Layer):
        raise TypeError('The added layer must be an instance of class Layer. Found: ' + str(layer))
    self.built = False
    if not self._layers:
        set_inputs = False
        if not isinstance(layer, InputLayer):
            first_layer = layer
            if isinstance(layer, (Model, Sequential)):
                if not layer.layers:
                    raise ValueError('Cannot add an empty model to a `Sequential` model.')
                first_layer = layer.layers[0]
                while isinstance(first_layer, (Model, Sequential)):
                    first_layer = first_layer.layers[0]
                batch_shape = first_layer.batch_input_shape
                dtype = first_layer.dtype
            if hasattr(first_layer, 'batch_input_shape'):
                batch_shape = first_layer.batch_input_shape
                dtype = first_layer.dtype
                x = Input(batch_shape=batch_shape, dtype=dtype, name=layer.name + '_input')
                layer(x)
                set_inputs = True
            else:
                batch_shape = None
        else:
            assert len(layer._inbound_nodes[-1].output_tensors) == 1
            set_inputs = True
        if set_inputs:
            if len(layer._inbound_nodes[-1].output_tensors) != 1:
                raise ValueError('All layers in a Sequential model should have a single output tensor. For multi-output layers, use the functional API.')
            self.outputs = [layer._inbound_nodes[-1].output_tensors[0]]
            self.inputs = network.get_source_inputs(self.outputs[0])
    elif self.outputs:
        output_tensor = layer(self.outputs[0])
        if isinstance(output_tensor, list):
            raise TypeError('All layers in a Sequential model should have a single output tensor. For multi-output layers, use the functional API.')
        self.outputs = [output_tensor]
    if self.inputs:
        self.build()
    else:
        self._layers.append(layer)

def build(self, input_shape=None):
    if input_shape and (not self.inputs):
        batch_shape = tuple(input_shape)
        dtype = K.floatx()
        x = Input(batch_shape=batch_shape, dtype=dtype, name=self.name + '_input')
        self.inputs = [x]
        for layer in self._layers:
            x = layer(x)
        self.outputs = [x]
        if self._layers:
            self._layers[0].batch_input_shape = batch_shape
    if self.inputs:
        self._init_graph_network(self.inputs, self.outputs, name=self.name)
        self.built = True

def predict_classes(self, x, batch_size=32, verbose=0):
    """Generate class predictions for the input samples.

    The input samples are processed batch by batch.

    # Arguments
        x: input data, as a Numpy array or list of Numpy arrays
            (if the model has multiple inputs).
        batch_size: integer.
        verbose: verbosity mode, 0 or 1.

    # Returns:
        A numpy array of class predictions.
    """
    proba = self.predict(x, batch_size=batch_size, verbose=verbose)
    if proba.shape[-1] > 1:
        return proba.argmax(axis=-1)
    else:
        return (proba > 0.5).astype('int32')

